    const area_code = remaining.slice(0, 2);      // "10"
    const first_part = remaining.slice(2, 6);    // "2534"
    const second_part = remaining.slice(6);      // "3415"

    return `${country_code}-${area_code}-${first_part}-${second_part}`;
}

