 * and inserting hyphens in the standard 010-XXXX-XXXX pattern.
 *
 * @param {string} raw_phone_number - The phone number as received (e.g., "010 2534 3415").
 * @returns {string} The formatted phone number (e.g., "010-2534-3415").
 */
function format_korean_phone_number(raw_phone_number) {
    // Remove any non‑digit characters (spaces, dashes, etc.)
    const digits_only = raw_phone_number.replace(/\D/g, '');

    // Ensure the number has exactly 11 digits for a typical mobile number
    if (digits_only.length !== 11) {
        throw new Error('Invalid Korean mobile phone number length.');
    }

    // Split into the three parts: 010, XXXX, XXXX
    const country_code = digits_only.slice(0, 3);
    const middle_part  = digits_only.slice(3, 7);
    const last_part    = digits_only.slice(7);

    // Return the hyphen‑separated format
    return `${country_code}-${middle_part}-${last_part}`;
}

